import React from "react";
import styled from "styled-components";
import { useDispatch, useSelector } from "react-redux";
import { addUserName } from "./redux/modules/rank";


const Start = (props) => {
    const dispatch = useDispatch();
    const nickname = useSelector((state) => state.nickname);
    const input_text = React.useRef(null);

    return (
        <div className="container">
            <h1>
                캐릭터들로 보는<br/>나의 성격 유형 테스트
            </h1>
            <p className="start-subtitle">나와 닮은 캐릭터는 누구일까?</p>

                <input className="nickname-input" ref={input_text} type="text" placeholder="닉네임을 입력해주세요"/>


            <button
                className="start-button"
                onClick={() => {
                    dispatch(addUserName(input_text.current.value));
                    props.history.push("/QnA");
                }}
            >
                START
            </button>
        </div>
    );
};

export default Start;
